      b ** ** ****
      John b. at Gisborne and m. at Manutuke Church. Address: "Coventry" Station, Main Road, RD 2,
    bounds:
      left: 591
      right: 2145
      top: 2298
      bottom: 2400
  - text: |
      Muriwai, Gisborne.
      John was educated at Ruatoria then Hereworth School, Wanganui Collegiate School and Lincoln
      College. He has worked on East Coast stations and a South Island high country station and also for
      several cartage and agricultural contractors. He now farms at Gisborne. John is a keen rugby
      player.
      Philippa was educated at Iona College and Havelock North High School where she excelled in both
      sporting and cultural activities. She majored in Physical Education at Palmerston North Teachers'
      College and gained a Diploma of Teaching. She graduated Bed from Massey University. Pip has been
      teaching Physical Education at Gisborne Girls' High School and is now one of Gisborne's competitive
      triathletes.
